package sec_test

import (
	"bytes"
	"io"
	"io/ioutil"
	"testing"

	"github.com/stairlin/kargo/pkg/sec"
	"github.com/stairlin/kargo/pkg/testutil"
	"github.com/stairlin/kargo/pkg/unit"
)

func TestReaderVerbatim(t *testing.T) {
	// Create keys
	keys := map[uint32][]byte{}
	for _, id := range []uint32{42, 43, 45} {
		key, err := sec.GenRandBytes(sec.KeySize)
		if err != nil {
			t.Fatalf("%v", err)
		}
		keys[id] = key
	}
	rotator := sec.NewRotator(keys, 43)

	expect := []byte(longText)
	plain := io.ReadCloser(ioutil.NopCloser(bytes.NewReader(expect)))
	chunkSize := int(32 * unit.KB)

	cipher, err := rotator.EncryptReader(plain, chunkSize)
	if err != nil {
		t.Fatal(err)
	}

	plain, err = rotator.DecryptReader(cipher, chunkSize)
	if err != nil {
		t.Fatal(err)
	}

	got, err := ioutil.ReadAll(plain)
	if err != nil {
		t.Fatal(err)
	}
	if len(expect) != len(got) {
		t.Errorf("expect length of %d, but got %d", len(expect), len(got))
	}
	if string(expect) != string(got) {
		t.Fatalf("expect text %s, but got %s",
			testutil.Truncate(expect, 140),
			testutil.Truncate(got, 140),
		)
	}

	if err := cipher.Close(); err != nil {
		t.Error("cipher reader err", err)
	}
	if err := plain.Close(); err != nil {
		t.Error("plain reader err", err)
	}
}

